PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?commander ?awardee ?gustavJonsonLeader
WHERE {
  # Find the commander in the Eastern Front during World War II
  ?commander a dbo:MilitaryPerson ;
             dbo:servedInMilitaryCampaign dbr:Eastern_Front_(World_War_II) .

  # Find someone who was awarded the Bruce Fraser, 1st Baron Fraser of North Cape award
  ?awardee dbo:award dbr:Bruce_Fraser,_1st_Baron_Fraser_of_North_Cape ;
             a dbo:NaturalPerson .

  # Find Gustav Jonson and his leader
  ?gustavJonson a dbo:Politician ;
                 dbo:leader ?gustavJonsonLeader .
}

