```sparql
SELECT ?institution ?politician ?mayor ?awardee WHERE {
  # Step 1: Identify an educational institution in Northern Ireland
  ?institution a <http://dbpedia.org/ontology/EducationalInstitution> ;
               <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Northern_Ireland> .

  # Step 2: Find a politician from Belfast who attended this institution
  ?politician a <http://dbpedia.org/ontology/Politician> ;
              <http://dbpedia.org/property/almaMater> ?institution ;
              <http://dbpedia.org/property/cityOfBirth> <http://dbpedia.org/resource/Belfast> .

  # Step 3: Determine the mayor of Belfast
  ?mayor a <http://dbpedia.org/ontology/Mayor> ;
          <http://dbpedia.org/property/city> <http://dbpedia.org/resource/Belfast> .

  # Step 4: Find someone who received the Royal Medal and also attended the same educational institution
  ?awardee a <http://dbpedia.org/ontology/Awardee> ;
             <http://dbpedia.org/property/almaMater> ?institution ;
             <http://dbpedia.org/resource/Royal_Medal> .

  FILTER(?politician != ?mayor && ?politician != ?awardee)
}
```

